create table CP.SYS_DEPT
(
    ID              VARCHAR2(64) not null
        primary key,
    DEPT_NO         VARCHAR2(64),
    NAME            VARCHAR2(64),
    PID             VARCHAR2(64),
    STATUS          NUMBER(10),
    RELATION_CODE   VARCHAR2(3000),
    DEPT_MANAGER_ID VARCHAR2(64),
    MANAGER_NAME    VARCHAR2(255),
    PHONE           VARCHAR2(20),
    CREATE_TIME     DATE,
    UPDATE_TIME     DATE,
    DELETED         NUMBER(10)
)
/

comment on table CP.SYS_DEPT is '部门'
